selector_to_html = {"a[href=\"#solutions-of-exercise-2-2\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 2.2<a class=\"headerlink\" href=\"#solutions-of-exercise-2-2\" title=\"Link to this heading\">#</a></h1><p>We want to control the angular position of a DC motor. The transfer function between the applied voltage and the position is</p>", "a[href=\"#solution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Solution<a class=\"headerlink\" href=\"#solution\" title=\"Link to this heading\">#</a></h2><h3>Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>We start by computing the closed-loop transfer function:</p>", "a[href=\"#solution-to-question-1\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Solution to question 1<a class=\"headerlink\" href=\"#solution-to-question-1\" title=\"Link to this heading\">#</a></h4><p>Any <span class=\"math notranslate nohighlight\">\\(K &gt; 0\\)</span> makes the closed-loop stable.</p><p>We can double-check this result looking at the root locus of the system.</p>", "a[href=\"#id1\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Case <span class=\"math notranslate nohighlight\">\\(\\Delta &lt; 0\\)</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h4><p>If <span class=\"math notranslate nohighlight\">\\(K &gt; 2.5\\)</span> the discriminant is negative, hence we have two complex-conjugate solutions</p>", "a[href=\"../lecture-1/exercise-1.3.html#ref-lec1-ex3\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Exercise 1.3<a class=\"headerlink\" href=\"#exercise-1-3\" title=\"Link to this heading\">#</a></h1><p><a class=\"sd-badge sd-outline-primary sd-rounded-pill\" href=\"../search.html?q=%22Analysis%20%E2%88%99%20Linear%20dynamical%20systems%22\">Analysis \u2219 Linear dynamical systems</a></p>", "a[href=\"#alternative-solution-with-the-routh-criterion\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Alternative solution with the Routh criterion<a class=\"headerlink\" href=\"#alternative-solution-with-the-routh-criterion\" title=\"Link to this heading\">#</a></h4><p>The characteristic polynomial, i.e., the denominator of <span class=\"math notranslate nohighlight\">\\(G_c(s)\\)</span>, is</p>", "a[href=\"#question-2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2<a class=\"headerlink\" href=\"#question-2\" title=\"Link to this heading\">#</a></h3><p>We now restrict ourselves to the case <span class=\"math notranslate nohighlight\">\\(K &gt; 0\\)</span>, where the closed-loop is stable. Thanks to the stability of the closed-loop, we can apply the Final Value Theore (where <span class=\"math notranslate nohighlight\">\\(\\Theta_{ref}(s) = \\frac{R}{s}\\)</span>)</p>", "a[href=\"#case-delta-0\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Case <span class=\"math notranslate nohighlight\">\\(\\Delta &gt; 0\\)</span><a class=\"headerlink\" href=\"#case-delta-0\" title=\"Link to this heading\">#</a></h4><p>If <span class=\"math notranslate nohighlight\">\\(K \\leq 2.5\\)</span>, the discriminant is positive (<span class=\"math notranslate nohighlight\">\\(\\Delta &gt; 0\\)</span>), which means we have two real solutions</p>", "a[href=\"#question-1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>We start by computing the closed-loop transfer function:</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
